// post component
import React, { Component } from "react";
import './style.css';
// import PlanitBtn from "../PlanitBtn";
import JoinBtn from "../JoinBtn";
import DeleteBtn from "../DeleteBtn";
import { TripList, ListItem } from "../TripList";
import API from "../../utils/API";

class Post extends Component {
    state = {
        post: [],
        country: "US",
        city: "Miami",
        planned: false,
        people: "Kyle",
        startMonth: "01",
        startDay: "02",
        startYear: "20",
        endMonth: "03",
        endDay: "04",
        endYear: "20"
    }

    componentDidMount() {
        this.loadTrips();
    }

    loadTrips = () => {
        API.getPosts()
            .then(res => {
                console.log(res)
                let startMonth = "";
                let startDay = "";
                let startYear = "";
                let endMonth = "";
                let endDay = "";
                let endYear = "";
                for (let i=0; i<res.data.length;i++) {
                if (res.data[i].startDate.length === 5) {
                    startMonth = res.data[i].startDate.charAt(0);
                    startDay = res.data[i].startDate.charAt(1)+res.data[i].startDate.charAt(2);
                    startYear = res.data[i].startDate.charAt(3)+res.data[i].startDate.charAt(4);
                } else {
                    startMonth = res.data[i].startDate.charAt(0)+res.data[i].startDate.charAt(1);
                    startDay = res.data[i].startDate.charAt(2)+res.data[i].startDate.charAt(3);
                    startYear = res.data[i].startDate.charAt(4)+res.data[i].startDate.charAt(5);
                }
                if (res.data[i].endDate.length === 5) {
                    endMonth = res.data[i].endDate.charAt(0);
                    endDay = res.data[i].endDate.charAt(1)+res.data[i].endDate.charAt(2);
                    endYear = res.data[i].endDate.charAt(3)+res.data[i].endDate.charAt(4);
                } else {
                    endMonth = res.data[i].endDate.charAt(0)+res.data[i].endDate.charAt(1);
                    endDay = res.data[i].endDate.charAt(2)+res.data[i].endDate.charAt(3);
                    endYear = res.data[i].endDate.charAt(4)+res.data[i].endDate.charAt(5);
                }

                this.setState({
                post: res.data[i],
                country: res.data[i].country,
                city: res.data[i].city,
                people: res.data[i].people,
                startMonth: startMonth,
                startDay: startDay,
                startYear: startYear,
                endMonth: endMonth,
                endDay: endDay,
                endYear: endYear
            })
        }
            console.log(this.state);
        }
            ).catch(err => console.log(err));
    };

    planTrip() {
        return (
            this.setState({ planned: true })
        );
    }
    nextTrip() {
        API.getPosts((req, res) => res.json(res)).then(response => response.json(response)).catch(err => console.log(err));
    }

    render() {
        return (
            <div className="postWrapper">
                <div className="innerWrapper">
                    <div className="postDest" >Destination: {this.state.city}, {this.state.country}</div>
                    <div className="postFriends">Friends: {this.state.people}</div>
                    <div className="postDates">Dates: {this.state.startMonth}/{this.state.startDay}/{this.state.startYear} - {this.state.endMonth}/{this.state.endDay}/{this.state.endYear}</div>
                    {this.state.post.length ? (
                        <TripList>
                            {this.state.post.map(post => (
                                <ListItem key={post.id}>
                                    <div key={post.id}> hi</div>
                                    <div className="tripLocation">{post.city}, {post.country}</div>
                                    <div className="tripPeople" key="travelers">Travelers: {post.people}</div>
                                    <div className="dates" key="dates">{post.startMonth}/{post.startDay} - {post.endMonth}/{post.endDay}</div>
                                </ListItem>
                ))}
                        </TripList>
                    ) : (
                            <h3>No Results to Display</h3>
                        )}
                                            <JoinBtn />
                    <DeleteBtn onClick={this.nextTrip} />
                </div>
            </div>
        );
    }
}

export default Post;
